Step-by-step reasoning:
1. Key psychological mechanisms include fairness comparisons and sensitivity to deviations from what a participant perceives as a “fair” share. In these tasks, responders are likely to compare the proposed share (split_self) to an expected fair share, which we can derive from the tokens earned by themselves and the opponent (token_self and token_opp) and the total available money (combined_earning). 
2. The mechanisms interact such that the perceived “fairness deviation” (the difference between the offered share and the fair share based on token contributions) modulates the utility the participant associates with accepting the proposal. A proposal closer to the fair share results in higher utility and, consequently, a higher probability of acceptance.
3. A logistic decision function is appropriate: the probability of acceptance is given by a logistic function applied to a linear combination of a baseline bias (beta0) and the fairness deviation scaled by a sensitivity parameter (beta1).
4. The mathematical form is: 
  U = beta0 + beta1 × (split_self − fair_share).
  The fair share is computed as the fraction of tokens earned by the participant from the sum of tokens times the combined earning, i.e., fair_share = combined_earning × (token_self/(token_self + token_opp)).
  Finally, the acceptance probability is: P(accept = 1) = 1/(1 + exp(−U)).
5. The parameters to be calibrated are beta0 (a baseline utility parameter) and beta1 (a fairness sensitivity parameter). Their bounds are chosen generously to be finite, with beta0 allowed to vary symmetrically and beta1 restricted to nonnegative values to preserve the direction of fairness sensitivity.
6. Mapping to observable behavior: the model uses the observed proposal (split_self), tokens (token_self and token_opp) and combined earning to compute a “fair share” baseline. The deviation from this fair share, scaled by beta1 and offset by beta0, drives the likelihood of the responder accepting (target variable: accept).

Below is the formal specification.

<MODEL>
P(accept=1) = 1/(1+exp(-(beta0 + beta1*(split_self - combined_earning*(token_self/(token_self+token_opp))))))
</MODEL>

